ymaps.ready(init);
function init() {
  var myMap = new ymaps.Map("map", {
    center: [51.050461, 3.743162],
    zoom: 10
  });
  var myGeoObject = new ymaps.GeoObject({
    geometry: {
      type: "Point",
      coordinates: [51.008176, 3.628080]
    }
  });
  myMap.behaviors.disable('scrollZoom');
  myMap.geoObjects.add(myGeoObject);
}
var burger = document.querySelector('.header__burger');
var close = document.querySelector('.header__close');
var mobileMenu = document.querySelector('.header__mobile');
var mobileLinks = document.querySelectorAll('.nav__link--mobile');
var order = document.querySelector('.btn--hero');
var modal = document.querySelector('.modal');
var send = document.querySelector('.btn--modal');
var forms = document.querySelectorAll('form');
forms.forEach(function (e) {
  e.addEventListener('submit', function (e) {
    e.preventDefault();
  });
});
burger.addEventListener('click', function () {
  mobileMenu.classList.add('header__mobile--active');
});
close.addEventListener('click', function () {
  mobileMenu.classList.remove('header__mobile--active');
});
mobileLinks.forEach(function (e) {
  e.addEventListener('click', function () {
    mobileMenu.classList.remove('header__mobile--active');
  });
});
modal.addEventListener('click', function (e) {
  e.stopPropagation();
  if (e.target.id === 'wrapper') {
    modal.classList.remove('modal--active');
  }
});
order.addEventListener('click', function () {
  modal.classList.add('modal--active');
});
send.addEventListener('click', function () {
  var data = [];
  var name = document.querySelector('#name2').value;
  var email = document.querySelector('#email2').value;
  var request = document.querySelector('#request2').value;
  if (name.length > 0 && email.length > 0 && request.length > 0) {
    data.push(name);
    data.push(email);
    data.push(request);
    fetch('https://jsonplaceholder.typicode.com/posts', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json;charset=utf-8'
      },
      body: JSON.stringify(data)
    }).then(function (res) {
      return console.log(res);
    })["catch"](function (err) {
      return console.log(err);
    });
  }
});
